window.bookSummaryJSON = "<p><b>The fae gods have awoken… and they're merciless.</b></p> <p>Sabine finally had a chance at a life with Basten. Simple. Free. But gods and men conspired to rip them apart. Now, on the eve of war, Sabine is trapped in her father's secret-shrouded court, prized as the gods' new plaything. She clings to memories of Basten, the only thing that grounds her in the dangerously bewitching new world. She'll play along in a desperate gamble to escape—but if she slips and shows her true hand, she'll be separated from Basten forever.</p> <p>Basten is haunted by a love he can't remember. Her face, her name—gone. But her scent lingers, and midnight dreams of his mystery woman torment him. His mind is a black pit of frustration and longing, driving him to question everything he once knew to be true. He follows his obsession north to Sabine's doorstep, where their paths will collide in a deadly game between them and the gods. And the gods don't like to lose.</p> <p><i>In this thrilling third installment in the Godkissed Bride series, Sabine and Basten cross worlds to reunite before they're permanently lost to one another—even in memory.</i></p>"; 
